import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';

import Home from './Pages/Home/Home';
import Category from './Pages/Category/Category';
import Internet_IT from './Pages/Internet_IT/Internet';
import MyApplication from './Pages/My-Application/MyApps';
import Shifts from './Pages/Shifts/Shifts';
import InternetStatus from './Pages/InternetStatus/InternetStatus';
import Chat from './Pages/Chats/Chats';
import Login from './Pages/Login/Login';
import Signup from './Pages/Signup/Signup';
import TechnicianProfile from './Protected_Apps/TechnicianProfile/TechnicianProfile';
import TechnicianTickets from './Protected_Apps/Tickets/TechnicianTickets';
import ClientProfile from './Protected_Apps/ClientProfile/ClientProfile';
import TechniProfile from './Pages/TechCategoryProfile/TechCategoryProfile';

function App() {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [username, setUsername] = useState('');
    const [userType, setUserType] = useState('');
    const [email, setEmail] = useState('');

    const handleLogin = (user) => {
        setIsAuthenticated(true);
        setUsername(user.username);
        setUserType(user.userType);
        setEmail(user.email);
    };

    const handleLogout = () => {
        setIsAuthenticated(false);
        setUsername('');
        setUserType('');
        setEmail('');
    };

    return (
        <Router>
            <Navbar 
                isAuthenticated={isAuthenticated} 
                username={username} 
                userType={userType}
                onLogout={handleLogout} 
            />
            <Routes>
                <Route path="/" element={<Home />} />

                {/* My Application routes */}

                <Route path="/category" element={<Category/>}>
                <Route path="internet" element={<Internet_IT />} />
                </Route>
                <Route path="/my-application" element={<MyApplication />}>
                    <Route path="tickets" element={<TechnicianTickets username={username} />} />

                </Route>

                {/* Technician profile with ID parameter */}
  <Route path="/technician-profile/:id" element={<TechnicianProfile userType={userType} />} />

  {/* Client profile route */}
  <Route path="/client-profile" element={<ClientProfile userType={userType} username={username} />} />

                <Route 
  path="/technician-profile" 
  element={

      <TechnicianProfile userType={userType} />  // Only technicians see this
  }
/>

                {/* Client profile route */}
                <Route path="/client-profile" element={
                     <ClientProfile userType={userType} username={username} />

                } />

                <Route path="/shifts" element={<Shifts />} />
                <Route path="/internet-status" element={<InternetStatus />} />
                <Route path="/chat" element={<Chat />} />
                <Route path="/login" element={<Login onLogin={handleLogin} />} />
                <Route path="/signup" element={<Signup />} />
            </Routes>
        </Router>
    );
}

export default App;
